class Shopping{
    constructor(){
        this.message = "Shop!";
        this.items = items;
        this.cart = [];
        this.total = this.getTotal(this.cart);
    }

    addToCart(item){
      this.cart.push(item);
      this.total = this.getTotal(this.cart);
      this.sessionCart = sessionStorage.setItem("cart",JSON.stringify(this.cart));
      
      console.log(this.cart);
    }

    getTotal(cart){
        var total = 0;
        for(var item = 0; item < cart.length; item++){
            total += cart[item].price;
        }
        return total;
    }
}